import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const WebHome = () => {
  return (
    <View style={styles.main}>
      <Text>WebHome</Text>
    </View>
  )
}

export default WebHome

const styles = StyleSheet.create({
    main: {flex: 1,
    backgroundColor: 'white'}
})
